import {
  BrowserRouter as Router,
  Routes as RouterCover,
  Route,
} from "react-router-dom";

export const Routes = () => {
  return (
    <Router>
      <AuthState>
        <RouterCover>
            <Route path="/" element={<Home />} />
        </RouterCover>
      </AuthState>
    </Router>
  );
};

export default Routes;
